    false,nt"url": null,nt"notes": "This narrative report for Bombay Hook NWR
    outlines Refuge accomplishments from May through August of 1952. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, and mammals- is also covered. The Refuge development and maintenance section
    discusses physical developments and plantings. Resource management is outlined;
    topics include timber removal. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, and Refuge participation. Items of interest,
    N-R forms, and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
